      {
        "id": 1,
        "comment": "TELA HD"
      }
    ]
  }

const PagesPromotionSearch = () =>{   
  return(
    <>
      <GlobalStyle/>
      <PromotionCard promotion={promotion}/>
    </>
  )
}



export default PagesPromotionSearch;
